// Include potly
const script = document.createElement("script")
script.src = "https://cdn.plot.ly/plotly-2.35.0.min.js"
document.body.appendChild(script)

// Setup layout
const plot_layout = { 
    title: { text: options.title },
    legend: { itemclick: false, itemdoubleclick: false }, 
    margin: { b: 50, l: 65, r: 50, t: 50 },
    xaxis: { title: { text: "time (s)" }, range: [-options.time, 0], zeroline: false, showline: true, mirror: true },
    yaxis: { title: { text: options.label }, zeroline: false, showline: true, mirror: true }
}

const plot_data = [
    { mode: 'lines', x: [], y:[], line: { color: options.color } }
]

data = {
    time: [],
    value: []
}

let plot_created = false

// Update plot
function update_data() {

    // Calculate time since sample
    const now = Date.now()
    const len = data.time.length
    const dt = new Array(len)
    for (let i = 0; i<len; i++) {
        dt[i] = (now - data.time[i]) / -1000.0
    }

    // See if there is any data to discard
    const last = dt.findLastIndex((x) => -x > options.time)
    if (last != -1) {
        data.time.splice(0, last)
        data.value.splice(0, last)
        dt.splice(0, last)
    }

    // Update plot
    plot_data[0].x = dt
    plot_data[0].y = data.value

    // Make sure plotly is loaded
    if (window.Plotly !== undefined) {
        if (!plot_created) {
            replot()
        }
        Plotly.redraw(div)
    }
}


function replot() {
    // Clear plot and redraw to cope with change in size or options
    plot_layout.title.text = options.title
    plot_layout.xaxis.range[0] = -options.time
    plot_layout.yaxis.title.text = options.label
    plot_data[0].line.color = options.color

    if (window.Plotly !== undefined) {
        Plotly.purge(div)
        Plotly.newPlot(div, plot_data, plot_layout, {displaylogo: false})
        plot_created = true
    }
}

// Watch for size changes
new ResizeObserver(() => { replot() }).observe(div)

// Runtime function
handle_msg = function (msg) {

    // Check message ID
    if (msg._id != options.message) {
        return
    }

    // Check for field
    if (!(options.field in msg)) {
        throw new Error("No field " + options.field + " in " + msg._name)
    }

    let value = msg[options.field]
    value *= options.scaleFactor

    // Add data
    data.value.push(value)
    data.time.push(Date.now())

    // Plot
    update_data()
}

// Add 10Hz update plot
setInterval(update_data, 100)

// Optional function to allow run-time update of options
handle_options = function (new_options) {
    options = new_options

    replot()
}

