// Update the position of home
function update_home(msg) {

    const id = msg._header.srcSystem

    const location = new L.LatLng(msg.latitude * (10**-7), msg.longitude * (10**-7))

    if (home[id] == null) {
        home_init(id, location)
    }

    home[id].setLatLng(location)
}

// Nav target line
function update_nav_target(msg) {

    const id = msg._header.srcSystem
    if (vehicle[id] == null) {
        // Vehicle is not shown yet
        return
    }

    if (vehicle[id].nav_target == null) {
        vehicle[id].nav_target = { 
            line: new L.polyline([], { color: "red", interactive: false }),
            timeoutID: null
        }
    }

    // Clear any existing timeout
    if (vehicle[id].nav_target.timeoutID != null) {
        clearTimeout(vehicle[id].nav_target.timeoutID)
    }

    function remove_nav_target(id) {
        // Clear any existing timeout
        if (vehicle[id].nav_target.timeoutID != null) {
            clearTimeout(vehicle[id].nav_target.timeoutID)
        }

        // Remove line
        if (map.hasLayer(vehicle[id].nav_target.line)) {
            map.removeLayer(vehicle[id].nav_target.line)
        }
    }

    const distance = msg.wp_dist
    if (distance == 0) {
        // Remove existing line
        remove_nav_target(id)
        return
    }

    // Get the current vehicle location and project the target
    let bearing = msg.target_bearing
    const vehicle_location = vehicle[id].marker.getLatLng()

    // https://makinacorpus.github.io/Leaflet.GeometryUtil/leaflet.geometryutil.js.html#line713
    bearing = (bearing + 360.0) % 360.0
    const rad = Math.PI / 180.0
    const radInv = 180.0 / Math.PI
    const R = 6378137 // approximation of Earth's radius
    const lon1 = vehicle_location.lng * rad
    const lat1 = vehicle_location.lat * rad
    const rheading = bearing * rad
    const sinLat1 = Math.sin(lat1)
    const cosLat1 = Math.cos(lat1)
    const cosDistR = Math.cos(distance / R)
    const sinDistR = Math.sin(distance / R)
    let lat2 = Math.asin(sinLat1 * cosDistR + cosLat1 * sinDistR * Math.cos(rheading))
    let lon2 = lon1 + Math.atan2(Math.sin(rheading) * sinDistR *  cosLat1, cosDistR - sinLat1 * Math.sin(lat2))
    lon2 = lon2 * radInv
    lon2 = lon2 > 180 ? lon2 - 360 : lon2 < -180 ? lon2 + 360 : lon2;


    const target_location = new L.LatLng(lat2 * radInv, lon2)

    // Set line location
    vehicle[id].nav_target.line.setLatLngs([vehicle_location, target_location])

    // Add to map if not already
    if (!map.hasLayer(vehicle[id].nav_target.line)) {
        map.addLayer(vehicle[id].nav_target.line)
    }

    // Register callback to remove line if no updates for 2 seconds
    vehicle[id].nav_target.timeoutID = setTimeout(remove_nav_target, 2000, id)

}

// Position target line
function update_position_target(msg) {

    const id = msg._header.srcSystem
    if (vehicle[id] == null) {
        // Vehicle is not shown yet
        return
    }

    const type_mask = msg.type_mask
    const TYPEMASK_X_IGNORE = 1
    const TYPEMASK_Y_IGNORE = 2
    if ((type_mask & (TYPEMASK_X_IGNORE | TYPEMASK_Y_IGNORE)) != 0) {
        // Location should be ignored
        return
    }

    if (vehicle[id].pos_target == null) {
        vehicle[id].pos_target = { 
            line: new L.polyline([], { color: "green", interactive: false }),
            timeoutID: null
        }
    }

    // Clear any existing timeout
    if (vehicle[id].pos_target.timeoutID != null) {
        clearTimeout(vehicle[id].pos_target.timeoutID)
    }

    function remove_pos_target(id) {
        // Clear any existing timeout
        if (vehicle[id].pos_target.timeoutID != null) {
            clearTimeout(vehicle[id].pos_target.timeoutID)
        }

        // Remove line
        if (map.hasLayer(vehicle[id].pos_target.line)) {
            map.removeLayer(vehicle[id].pos_target.line)
        }
    }

    // Set line location
    const vehicle_location = vehicle[id].marker.getLatLng()
    const target_location = new L.LatLng(msg.lat_int * (10**-7), msg.lon_int * (10**-7))
    vehicle[id].pos_target.line.setLatLngs([vehicle_location, target_location])

    // Add to map if not already
    if (!map.hasLayer(vehicle[id].pos_target.line)) {
        map.addLayer(vehicle[id].pos_target.line)
    }

    // Register callback to remove line if no updates for 2 seconds
    vehicle[id].pos_target.timeoutID = setTimeout(remove_pos_target, 2000, id)
}


// Runtime function
handle_msg = function (msg) {

    // Make sure map is loaded
    if (map == null) {
        return
    }

    if (msg._header.srcComponent != 1) {
        // Only interested in messages from MAV_COMP_ID_AUTOPILOT1
        return
    }

    if (msg._id == 33) {
        // GLOBAL_POSITION_INT
        update_pos(msg)

    } else if (msg._id == 242) {
        // HOME_POSITION
        update_home(msg)

    } else if (msg._id == 62) {
        // NAV_CONTROLLER_OUTPUT
        update_nav_target(msg)

    } else if (msg._id == 87) {
        // POSITION_TARGET_GLOBAL_INT
        update_position_target(msg)
    }

}

// Options changed
handle_options = function(new_options) {
    options = new_options
}

// Import Gauges from https://github.com/teocci/js-module-flight-indicators
// Add ccs with link tag
const ccs = document.createElement('link')
ccs.rel = "stylesheet"
ccs.href = "https://unpkg.com/flight-indicators-js@1.0.5/css/flight-indicators.css"
document.body.appendChild(ccs)

let attitude
import("https://unpkg.com/flight-indicators-js@1.0.5/esm/module-flight-indicators.mjs").then((mod) => {
    const FlightIndicators = mod.default

    attitude = new FlightIndicators(
        div,
        FlightIndicators.TYPE_ATTITUDE
    )

    // This is a dirty hack to switch to remote copy's of images
    let images = div.querySelectorAll("img")
    for (const image of images) {
        let src = image.src

        var lastIndex = src.lastIndexOf("/img/")
        image.src = "https://unpkg.com/flight-indicators-js@1.0.5" + src.substr(lastIndex)

        // Hide box is broken, hide manually
        // see: https://github.com/teocci/js-module-flight-indicators/pull/1
        if (src.endsWith("fi_box.svg")) {
            image.style.display = "none"
        }
    }

    resize()
})

// Remove margin and border to give more room
div.style.margin = 0
div.style.border = 0
div.style.padding = 0

// Center gauge
div.style.display = "flex"
div.style.justifyContent = "center"
div.style.alignItems = "center"

function resize() {

    if (attitude == null) {
        return
    }

    // Get width and height of widget
    const width = div.offsetWidth
    const height = div.offsetHeight

    const max_size = Math.min(width, height)
    attitude.resize(max_size)
}

// Watch for size changes
new ResizeObserver(() => { resize() }).observe(div)

const ATTITUDE_id = 30

// Runtime function
handle_msg = function(msg) {

    if (msg._id != ATTITUDE_id) {
        return
    }

    if (attitude == null) {
        return
    }

    function rad2deg(rad) {
        return rad * (180.0 / Math.PI)
    }

    // Roll is backwards for some reason...
    attitude.updateRoll(-rad2deg(msg.roll))

    attitude.updatePitch(rad2deg(msg.pitch))
}

